import React from "react";
import { connect } from "react-redux";

// const names = ["James", "Paul", "John", "George", "Ringo"];

const mapStateToProps = (state) => {
  return {
    getLoggingList: state.inventorys.getLoggingList,
    errorLoggingList: state.inventorys.errorLoggingList,
    HitungLogging: state.inventorys.getLoggingList.length, //HITUNG JUMLAH DATA LOGGING
  };
};

const File1 = (props) => {
  const createTable = () => {
    let table = [];
    let counter;

    for (let j = 0; j < props.HitungLogging; j++) {
      table.push(<td>{props.getLoggingList[j].qty}</td>);
    }
    return table;
  };
  return <table>{createTable()}</table>;
};

export default connect(mapStateToProps, null)(File1);
